import React from 'react';
import * as S from "./project-header.styles"
import Text from "../common/Text";


const Project_Header = ({color, title, expertise}) => {
    return (
        <S.Project_Header_Wrapper>
            <S.Project_Title_Wrapper>
                <Text
                    as={"h2"}
                    color={color}
                    fontSize={"80px"}
                    fontWeight={600}
                    lineHeight={"84.5%"}
                >{title}</Text>
                <div>
                    <Text
                        as={"h3"}
                        color={color}
                        fontSize={"12px"}
                        fontWeight={800}
                        lineHeight={"98.5%"}
                    >EXPERTISE</Text>
                    <Text>
                        {expertise}
                    </Text>
                </div>
                <div>
                    <Text
                        as={"h3"}
                        color={color}
                        fontSize={"12px"}
                        fontWeight={800}
                        lineHeight={"98.5%"}
                    >Platform</Text>
                    <Text>
                        {expertise}
                    </Text>
                </div>
                <div>
                    <Text
                        as={"h3"}
                        color={color}
                        fontSize={"12px"}
                        fontWeight={800}
                        lineHeight={"98.5%"}
                    >Technology</Text>
                    <Text>
                        {technologies}
                    </Text>
                </div>

            </S.Project_Title_Wrapper>
        </S.Project_Header_Wrapper>
    )
}
export default Project_Header;
